export default class Hooks {
  static BASE_URL = "https://beta.reactjs.org/reference/react/";

  static listData = [
    {
      btnContent: `useState()`,
      href: this.BASE_URL + "useState",
    },
    {
      btnContent: `useEffect()`,
      href: this.BASE_URL + "useEffect",
    },
    {
      btnContent: `useReducer()`,
      href: this.BASE_URL + "useReducer",
    },
    {
      btnContent: `useContext()`,
      href: this.BASE_URL + "useContext",
    },
  ];
}
